Heliekvalaiser (ekvivaler) võib luua ruumilise heli efekti, suurendada bassi ja suurendada seadme maksimaalset helitugevust.

Selle abil saate reguleerida helivoo erinevate sageduste taset või suurendada nii madalaid (bass) kui ka kõrgeid sagedusi. Saate seda kasutada ekvalaiserina YouTube'i ja muude voogesitatavate heli- ja videosaitide jaoks.
