long.fil:
Pinapayagan ka ng Audio Equalizer na ayusin ang balanse sa pagitan ng mga bahagi ng dalas na may isang 10-band audio equalizer, maraming iba't ibang mga setting ng tunog at mahusay na kontrol para sa kalidad ng tunog.

Ginamit nang tama, makakatulong ito sa iyo na pakinisin ang tunog, ginagawang mas maganda at mas malinis, maging pagdaragdag ng dami sa mababang mga frequency, pag-aalis ng ilan sa mga mataas na frequency, o pag-aayos ng gitnang balanse sa pagitan nila.

Ito ay isang madaling gamiting tool upang matulungan kang ipasadya ang tunog para sa iyo. Ang pangbalanse ng audio na may 21 mga preset na profile para sa iba't ibang mga genre ng musika at para sa iyong panlasa.
Maaari mong palaging i-edit ang mga ito ayon sa gusto mo at i-save ang iyong mga profile.

Ang Audio Equalizer (Eq) ay maaaring lumikha ng isang nakapaligid na sound effects, mapalakas ang bass at madagdagan ang maximum na dami ng iyong aparato.

Maaari mo itong gamitin upang ayusin ang antas ng iba't ibang mga frequency sa audio stream, o upang mapalakas ang parehong mababang mga frequency (bass) at mataas na mga frequency. Maaari mo itong magamit bilang isang pantay para sa YouTube at iba pang streaming audio, mga site ng video.
Bilang karagdagan, mayroon kaming maraming iba pang mga tampok na maaaring sorpresahin ka.

Ang ilan sa aming madaling gamiting mga tampok sa Equalizer:
    - Mga kontrol ng dami ng Preamplifier;
    - 10 saklaw para sa pag-aayos ng tunog;
