אתה יכול להשתמש בו כדי להתאים את רמת התדרים השונים בזרם השמע, או להגביר תדרים נמוכים (בס) וגם תדרים גבוהים. אתה יכול להשתמש בו כאקולייזר עבור YouTube ואתרי אודיו ווידאו זורמים אחרים.
בנוסף, יש לנו תכונות רבות אחרות שעשויות להפתיע אותך.

