     - Penguat vokal.

long.no:
Audio Equalizer lar deg justere balansen mellom frekvenskomponenter med en 10-bånds lydutjevner, mange forskjellige lydinnstillinger og utmerket kontroll for kvalitetslyd.

Brukt riktig kan det hjelpe deg med å glatte ut lyden, gjøre den finere og renere, enten det er å legge til volum til de lave frekvensene, fjerne noen av de høye frekvensene eller justere mellombalansen mellom dem.

Dette er et praktisk verktøy som hjelper deg med å tilpasse lyden for deg. Audio equalizer med 21 forhåndsinnstilte profiler for forskjellige musikksjangre og for din smak.
Du kan alltid redigere dem etter eget ønske og lagre profilene dine.

Audio Equalizer (Eq) kan skape en surroundlydeffekt, øke bass og øke maksimalt volum på enheten.

Du kan bruke den til å justere nivået på forskjellige frekvenser i lydstrømmen, eller for å øke både lave frekvenser (bass) og høye frekvenser. Du kan bruke den som en equalizer for YouTube og andre lyd-, videosider.
I tillegg har vi mange andre funksjoner som kan overraske deg.

Noen av de praktiske Equalizer-funksjonene våre:
    - Forsterkerens volumkontroller;
    - 10 områder for lydjustering;
    - 21 forhåndsinnstillinger som er klare til bruk;
    - Lav CPU-bruk mens du kjører;
    - Boost / Cut frekvens i hvert bånd er +/- 12 dB;
    - Helt gratis equalizer-utvidelse.

