long.ru:
Audio Equalizer позволяет вам регулировать баланс между частотными компонентами на 10-полосном аудио эквалайзере, множеством различных звуковых настроек и отличной регулировкой для качественного звука. 

Если он используется правильно, он поможет вам сгладить звук, сделав его приятнее и чище, будь то добавление объема к нижним частотам, снимая часть с высоких звуковых частот или настроить средний баланс между ними.

Это удобный инструмент, который поможет вам настроить звук под вас. Аудио эквалайзер с 21 предустановленным профилями под разные музыкальные жанры и под ваш вкус.
Вы всегда можете отредактировать их по своему вкусу и сохранить свои профили.

Audio Equalizer (Eq) может создать эффект объемного звучания, усилить бас и увеличить максимальную громкость на вашем устройстве.

Вы можете использовать его для регулировки уровня различных частот аудиопотока или для увеличения как низких частот (басов), так и высоких. Вы можете использовать его как эквалайзер для YouTube и других потоковых аудио, видео сайтов.
Кроме того, у нас есть много других функций, которые могут вас удивить.

Некоторые из наших удобных функций Equalizer:
    - Регуляторы громкости предусилителя;
    - 10 диапазонов для регулировки звука;
    - 21 готовый к использованию пресет;
    - Низкое использование ЦП во время работы;
    - Усиление / Подавление частоты на каждой полосе составляет +/- 12 дБ;
    - Абсолютно бесплатное расширение эквалайзер.

