long.sk:
Audio ekvalizér vám umožňuje upraviť vyváženie medzi frekvenčnými komponentmi pomocou 10pásmového audio ekvalizéra, mnohých rôznych nastavení zvuku a vynikajúcej kontroly kvalitného zvuku.

Pri správnom použití vám môže pomôcť vyhladiť zvuk, urobiť ho krajším a čistejším, či už ide o zvýšenie hlasitosti na nízke frekvencie, odstránenie niektorých vysokých frekvencií alebo úpravu stredného vyváženia medzi nimi.

Toto je užitočný nástroj, ktorý vám pomôže prispôsobiť zvuk pre vás. Audio ekvalizér s 21 prednastavenými profilmi pre rôzne hudobné žánre a pre váš vkus.
Môžete ich kedykoľvek upraviť podľa svojich predstáv a uložiť svoje profily.

Zvukový ekvalizér (Eq) dokáže vytvoriť efekt priestorového zvuku, zvýrazniť basy a zvýšiť maximálnu hlasitosť vášho zariadenia.

Môžete ho použiť na nastavenie úrovne rôznych frekvencií vo zvukovom streame alebo na zvýšenie nízkych frekvencií (basy) a vysokých frekvencií. Môžete ho použiť ako ekvalizér pre YouTube a ďalšie streamované zvukové a obrazové stránky.
Okrem toho máme mnoho ďalších funkcií, ktoré vás môžu prekvapiť.

Niektoré z našich užitočných funkcií ekvalizéra:
    - Ovládanie hlasitosti predzosilňovača;
    - 10 rozsahov pre nastavenie zvuku;
    - 21 predvolieb pripravených na použitie;
    - Nízke využitie CPU pri behu;
    - Frekvencia zvýšenia / zníženia v každom pásme je +/- 12 dB;
    - Absolútne bezplatné rozšírenie ekvalizéra.

Zoznam predvolieb zvukového ekvalizéra:
     - akustické;
     - Zosilňovač basov (Bass Booster, Volume Booster);
     - basový reduktor;
     - klasický;
     - tanec;
     - hlboký;
     - elektronická;
     - Hip-hop;
     - jazz;
     - latinská hudba;
     - objem;
