     - Vysokofrekvenčný zosilňovač;
     - Vysokofrekvenčný reduktor;
     - Vokálny zosilňovač.

long.sl:
Zvočni izenačevalnik omogoča nastavitev ravnovesja med frekvenčnimi komponentami z 10-pasovnim izenačevalnikom zvoka, številnimi različnimi nastavitvami zvoka in odličnim nadzorom za kakovosten zvok.

Če ga pravilno uporabljate, vam lahko pomaga zgladiti zvok, ga narediti lepšega in čistejšega, ne glede na to, ali dodaja glasnost nizkim frekvencam, odstrani nekatere visoke frekvence ali prilagodi srednje ravnovesje med njimi.

To je priročno orodje za lažje prilagajanje zvoka. Zvočni izenačevalnik z 21 prednastavljenimi profili za različne glasbene zvrsti in po vašem okusu.
Vedno jih lahko uredite po svojih željah in shranite svoje profile.

Zvočni izenačevalnik (Eq) lahko ustvari prostorski zvočni učinek, poveča nizke tone in poveča največjo glasnost v napravi.

Z njim lahko prilagodite raven različnih frekvenc v zvočnem toku ali pa povečate nizke in nizke frekvence. Uporabite ga lahko kot izenačevalnik za YouTube in druga spletna mesta za pretakanje zvoka in videa.
Poleg tega imamo še veliko drugih funkcij, ki vas lahko presenetijo.

Nekaj ​​naših priročnih funkcij izenačevalnika:
    - nadzor glasnosti predojačevalnika;
    - 10 razponov za nastavitev zvoka;
    - 21 pripravljenih prednastavitev;
    - Nizka poraba CPU med izvajanjem;
    - Frekvenca ojačanja / rezanja v vsakem pasu je +/- 12 dB;
    - Popolnoma brezplačen podaljšek izenačevalnika.

Seznam prednastavljenih zvočnih izenačevalnikov:
     - zvočni;
     - ojačevalnik nizkih tonov (ojačevalec nizkih tonov, ojačevalec glasnosti);
